// nome do pokemon;
// tipo do pokemon;
// peso médio do pokemon, acompanhado da unidade de medida usada;
// imagem do pokemon.

import React from 'react';
class Pokemon extends React.Component {
    render() {
      const { data } = this.props;
      return(
        <div>
          <p>nome:{data.name}</p>
          <p>Tipo:{data.type}</p>
          <p>Peso:{data.averageWeight.value}</p>
          <p>{data.image}</p>
        </div>
      );
    }
}

export default Pokemon
